  false,\n\t\"url\": null,\n\t\"notes\": \"From 1985 to 1994, a series of reports
  on coal resources of selected counties in Indiana was published as part of the Special
  Report series of the Indiana Geological Survey. These reports included maps showing
  elevation of the Hymera Coal Member (Dugger Formation, Pennsylvanian). The elevation
  maps were based on coal-test records and interpretations of geophysical logs that
  are included in the files of the Indiana Geological Survey. Data points were plotted
  by coal geologists of the Indiana Geological Survey and elevation contours were
  drawn by hand. The original work maps were compiled at a scale of 0.5 inch = 1 mile
  (1:126,720). Following completion of the investigations, the work maps showing elevation
  contours were subsequently scanned and digitized, and the resulting county coverages
  were then compiled into a single multi-county coverage. Elevations are given in
  feet, and the contour interval is 20 feet. Since the completion of this shapefile,
  additional data on coalbed elevations in selected areas has been obtained by the
  Indiana Geological Survey; interested users may wish to contact the Indiana Geological
  Survey for information on these more up-to-date sources.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
